import React, { Component } from "react";
import { connect } from "react-redux";
import "./FeaturedDoctors.scss";
import { FormattedMessage } from "react-intl";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
// import medicalImg from "../../../assets/FeaturedDoctors/1.jpg";
import Carousel from "react-bootstrap/Carousel";
import ExampleCarouselImage from "../../../components/ExampleCarouselImage";
import medicalImg from "../../../assets/medical/1.jpg";
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";
class FeaturedDoctors extends Component {
    render() {
        let settings = {
            dots: false,
            infinite: true,
            speed: 500,
            slidesToShow: 4,
            slidesToScroll: 2,
            nextArrow: <div className="slick-next"></div>,
            prevArrow: <div className="slick-prev"></div>,
        };
        return (
            <React.Fragment>
                <div className="section-doctors">
                    <div className="doctors-content">
                        <div className="doctors-header">
                            <div className="doctors-title mb-3 ml-1">
                                Bác sĩ nổi bật tuần qua
                            </div>
                            <button
                                type="button"
                                class="btn btn-outline-primary"
                            >
                                Tìm kiếm
                            </button>
                        </div>

                        <Slider {...settings}>
                            <div className="doctors-item">
                                <Card style={{ width: "18rem" }}>
                                    <Card.Img
                                        variant="top"
                                        src="holder.js/100px180"
                                    />
                                    <Card.Body>
                                        <Card.Title>Card Title</Card.Title>
                                        <Card.Text>
                                            Some quick example text to build on
                                            the card title and make up the bulk
                                            of the card's content.
                                        </Card.Text>
                                        <Button variant="primary">
                                            Go somewhere
                                        </Button>
                                    </Card.Body>
                                </Card>
                                {/* <img
                                    className="doctors-img"
                                    src={medicalImg}
                                    alt="doctors"
                                /> */}
                                <span className="doctors-title">
                                    Bệnh viện Bạch Mai
                                </span>
                            </div>
                            <div className="doctors-item">
                                <img
                                    className="doctors-img"
                                    src={medicalImg}
                                    alt="doctors"
                                />
                                <span className="doctors-title">
                                    Bệnh viện Bạch Mai
                                </span>
                            </div>
                            <div className="doctors-item">
                                <img
                                    className="doctors-img"
                                    src={medicalImg}
                                    alt="doctors"
                                />
                                <span className="doctors-title">
                                    Bệnh viện Bạch Mai
                                </span>
                            </div>
                            <div className="doctors-item">
                                <img
                                    className="doctors-img"
                                    src={medicalImg}
                                    alt="doctors"
                                />
                                <span className="doctors-title">
                                    Bệnh viện Bạch Mai
                                </span>
                            </div>
                            <div className="doctors-item">
                                <img
                                    className="doctors-img"
                                    src={medicalImg}
                                    alt="doctors"
                                />
                                <span className="doctors-title">
                                    Bệnh viện Bạch Mai
                                </span>
                            </div>
                            <div className="doctors-item">
                                <img
                                    className="doctors-img"
                                    src={medicalImg}
                                    alt="doctors"
                                />
                                <span className="doctors-title">
                                    Bệnh viện Bạch Mai
                                </span>
                            </div>
                        </Slider>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}

const mapStateToProps = (state) => {
    return {
        language: state.app.language,
        isLoggedIn: state.user.isLoggedIn,
    };
};

const mapDispatchToProps = (dispatch) => {
    return {};
};

export default connect(mapStateToProps, mapDispatchToProps)(FeaturedDoctors);
